import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import SignUp from './components/SignUp';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route element={<SignUp />} to=''/>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
